import{_ as e,o,c as d,e as c}from"./app.e2a3b496.js";const t={},i=c(`<h1 id="adb-logcat\u4F7F\u7528\u7B80\u4ECB" tabindex="-1"><a class="header-anchor" href="#adb-logcat\u4F7F\u7528\u7B80\u4ECB" aria-hidden="true">#</a> adb logcat\u4F7F\u7528\u7B80\u4ECB</h1><p>\u5F97\u6709\u534A\u5E74\u6CA1\u5199\u65E5\u8BB0\u4E86\uFF0C\u4ECA\u5929\u4E0D\u592A\u5FD9\uFF0C\u62BD\u7A7A\u5199\u4E00\u4E2A\u7B80\u5355\u7684\u5165\u95E8\uFF0C\u56E0\u4E3A\u5F88\u957F\u65F6\u95F4\u6CA1\u7528\u4E86\uFF0C\u6700\u8FD1\u7528\u8D77\u6765\u53D1\u73B0\u5DF2\u7ECF\u5FD8\u4E86.....</p><p><code>android</code>\u5F00\u53D1\u8FC7\u7A0B\u4E2D\u6211\u4EEC\u7ECF\u5E38\u4F1A\u7528\u5230<code>log</code>\uFF0C\u867D\u7136\u5E73\u65F6\u5927\u591A\u7528<code>studio</code>\uFF0C\u4F46\u662F\u5982\u679C\u6D4B\u8BD5\u53D1\u73B0\u4E00\u4E2A<code>crash</code>\u65F6\u8DD1\u8FC7\u6765\u627E\u4F60\u65F6\u4F60\u4F1A\u53D1\u73B0\u7528<code>studio</code>\u5DF2\u7ECF\u6709\u70B9\u8FDF\u4E86\u3002\u8FD9\u65F6\u5019\u5C31\u8981\u6253\u5F00<code>adb logcat</code>. \u5FD8\u8BB0\u600E\u4E48\u52A0\u53C2\u6570\u4E86\u600E\u4E48\u529E\uFF1F \u9ED8\u9ED8\u7684\u6253\u5F00<code>adb logcat --help</code>\u4F60\u4F1A\u53D1\u73B0\u53EA\u8981\u4F60\u80AF\u52AA\u529B\uFF0C\u4F60\u80AF\u5B9A\u80FD\u628A\u6240\u6709\u7684\u4E8B\u60C5\u90FD\u641E\u57AE\u3002</p><p><code>adb logcat --help</code></p><p><code>Usage: logcat [options] [filterspecs]</code></p><h2 id="options-include" tabindex="-1"><a class="header-anchor" href="#options-include" aria-hidden="true">#</a> <code>options include:</code></h2><ul><li><p><code>-s</code> <code>Set default filter to silent. Like specifying filterspec &#39;*:s&#39;\u8BBE\u7F6E\u9ED8\u8BA4\u7684\u8FC7\u6EE4\u5668,\u6211\u4EEC\u60F3\u8981\u8F93\u51FA\u5305\u542B&quot;System.out&quot;\u5173\u952E\u5B57\u7684\u6807\u7B7E\u6216\u4FE1\u606F, \u5C31\u53EF\u4EE5\u4F7F\u7528adb logcat -s System.out \u547D\u4EE4;</code></p></li><li><p><code>-f &lt;filename&gt;</code> <code>Log to file. Default to stdout \u5C06\u65E5\u5FD7\u8F93\u51FA\u5230\u6587\u4EF6,\u6CE8\u610F\u8FD9\u662F\u624B\u673A\u91CC\u7684\u6587\u4EF6\uFF0C\u4F7F\u7528adb logcat -f /sdcard/log.txt</code></p></li><li><p><code>-r [&lt;kbytes&gt;]</code> <code>Rotate log every kbytes. (16 if unspecified). Requires -f \u6309\u7167\u6BCF\u5343\u5B57\u8282\u8F93\u51FA\u65E5\u5FD7\uFF0C\u9700\u8981\u4E0E-f\u4E00\u8D77\u4F7F\u7528</code></p></li><li><p><code>-n &lt;count&gt;</code> <code>Sets max number of rotated logs to &lt;count&gt;, default 4 \u8BBE\u7F6E\u65E5\u5FD7\u8F93\u51FA\u7684\u6700\u5927\u6570\u76EE</code></p></li><li><p><code>-v &lt;format&gt;</code> <code>Sets the log print format, where &lt;format&gt; is one of: brief process tag thread raw time threadtime long \u8BBE\u7F6E\u65E5\u5FD7\u7684\u8F93\u51FA\u683C\u5F0F, \u6CE8\u610F\u53EA\u80FD\u8BBE\u7F6E\u4E00\u9879\uFF0C\u8FD9\u91CC\u683C\u5F0F\u6BD4\u8F83\u591A\uFF0C\u6211\u4EEC\u6700\u540E\u8BB2</code></p></li><li><p><code>-c</code> <code>clear (flush) the entire log and exit \u6E05\u7A7A\u6240\u6709\u7684\u65E5\u5FD7\u7F13\u5B58\u4FE1\u606F</code></p></li><li><p><code>-d</code> <code>dump the log and then exit (don&#39;t block) \u5C06\u7F13\u5B58\u7684\u65E5\u5FD7\u8F93\u51FA\u5230\u5C4F\u5E55\u4E0A, \u5E76\u4E14\u4E0D\u4F1A\u963B\u585E;</code></p></li><li><p><code>-t &lt;count&gt;</code> <code>print only the most recent &lt;count&gt; lines (implies -d) \u8F93\u51FA\u6700\u8FD1\u7684\u51E0\u884C\u65E5\u5FD7, \u8F93\u51FA\u5B8C\u9000\u51FA, \u4E0D\u963B\u585E;</code><code>-g</code> <code>get the size of the log&#39;s ring buffer and exit \u67E5\u770B\u65E5\u5FD7\u7F13\u51B2\u533A\u4FE1\u606F</code><code>-b &lt;buffer&gt;</code> <code>Request alternate ring buffer, &#39;main&#39;, &#39;system&#39;, &#39;radio&#39; or &#39;events&#39;. Multiple -b parameters are allowed and the results are interleaved. The default is -b main -b system.\u52A0\u8F7D\u4E00\u4E2A\u65E5\u5FD7\u7F13\u51B2\u533A, \u9ED8\u8BA4\u662F main</code><br><code>-B</code> <code>output the log in binary \u4EE5\u4E8C\u8FDB\u5236\u5F62\u5F0F\u8F93\u51FA\u65E5\u5FD7</code></p></li></ul><h2 id="filterspecs-are-a-series-of" tabindex="-1"><a class="header-anchor" href="#filterspecs-are-a-series-of" aria-hidden="true">#</a> <code>filterspecs are a series of </code></h2><p><code>&lt;tag&gt;[:priority]</code> \u8FC7\u6EE4\u9879\u683C\u5F0F\u4E3A\u6807\u7B7E:\u65E5\u5FD7\u7B49\u7EA7, \u9ED8\u8BA4\u7684\u65E5\u5FD7\u8FC7\u6EE4\u9879\u662F <code>*:I</code>;</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>where &lt;tag&gt; is a log component tag (or * for all) and priority is:      

  - V    Verbose
  - D    Debug
  - I    Info
  - W    Warn
  - E    Error
  - F    Fatal
  - S    Silent (supress all output)

&#39;*&#39; means &#39;*:d&#39; and &lt;tag&gt; by itself means &lt;tag&gt;:v

If not specified on the commandline, filterspec is set from ANDROID_LOG_TAGS.
If no filterspec is found, filter defaults to &#39;*:I&#39;\u9ED8\u8BA4\u4F7F\u7528\u7684\u662F*:I\u7EA7\u522B\u7684\u3002

If not specified with -v, format is set from ANDROID_PRINTF_LOG
or defaults to &quot;brief&quot;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>\u4F8B\u5982<code>adb logcat *:E</code> \u662F\u6307\u5B9A\u53EA\u663E\u793A<code>error</code>\u7EA7\u522B\u7684<code>log</code>\uFF0C <code>adb logcat xxx:D *:S</code> \u662F\u6307\u5B9A\u53EA\u663E\u793A\u6807\u7B7E\u4E3A<code>xxx</code>\u4E14<code>debug</code>\u7EA7\u522B\u4EE5\u4E0A\u7684<code>Log</code>\u3002\u4E3A\u4EC0\u4E48\u8981\u52A0\u4E0A<code>*:S</code>\u5462\uFF0C<code>*:S</code>\u7528\u4E8E\u8BBE\u7F6E\u6240\u6709\u6807\u8BB0\u7684\u65E5\u5FD7\u4F18\u5148\u7EA7\u4E3A<code>S</code>\uFF0C\u8FD9\u6837\u53EF\u4EE5\u786E\u4FDD\u4EC5\u8F93\u51FA\u7B26\u5408\u6761\u4EF6\u7684\u65E5\u5FD7\u3002</p><p>\u4E0A\u9762\u57FA\u672C\u7684\u53C2\u6570\u90FD\u4ECB\u7ECD\u5B8C\u4E86\u3002\u4E0B\u9762\u8BF4\u4E00\u4E9B\u5E38\u7528\u7684\u529F\u80FD\u3002</p><h2 id="\u91C7\u7528grep\u6B63\u5219\u8868\u8FBE\u5F0F\u8FC7\u6EE4" tabindex="-1"><a class="header-anchor" href="#\u91C7\u7528grep\u6B63\u5219\u8868\u8FBE\u5F0F\u8FC7\u6EE4" aria-hidden="true">#</a> \u91C7\u7528grep\u6B63\u5219\u8868\u8FBE\u5F0F\u8FC7\u6EE4</h2><p>\u8FC7\u6EE4\u56FA\u5B9A\u5B57\u7B26\u4E32 : \u53EA\u8981\u547D\u4EE4\u884C\u51FA\u73B0\u7684\u65E5\u5FD7\u90FD\u53EF\u4EE5\u8FC7\u6EE4, \u4E0D\u7BA1\u662F\u4E0D\u662F\u6807\u7B7E;</p><p><code>adb logcat | grep -E &#39;^[VDE]/(TAG1|TAG2)&#39;</code></p><p><code>adb logcat | grep Wifi</code><code>adb logcat | grep -i wifi \u8FC7\u6EE4\u5B57\u7B26\u4E32\u5FFD\u7565\u5927\u5C0F\u5199</code><code>adb logcat | grep --color=auto -i myapp #\u8BBE\u7F6E\u5339\u914D\u5B57\u7B26\u4E32\u989C\u8272\u3002\u66F4\u591A\u8BBE\u7F6E\u8BF7\u67E5\u770B grep \u5E2E\u52A9\u3002</code></p><h2 id="\u5728\u540C\u65F6\u8F93\u51FA\u5230\u5C4F\u5E55\u548C\u6587\u4EF6tee" tabindex="-1"><a class="header-anchor" href="#\u5728\u540C\u65F6\u8F93\u51FA\u5230\u5C4F\u5E55\u548C\u6587\u4EF6tee" aria-hidden="true">#</a> \u5728\u540C\u65F6\u8F93\u51FA\u5230\u5C4F\u5E55\u548C\u6587\u4EF6tee</h2><p>\u60F3\u8981\u628A\u65E5\u5FD7\u4FDD\u5B58\u5230\u6587\u4EF6,\u5982\u679C\u91C7\u7528IO\u91CD\u5B9A\u5411,\u5C31\u65E0\u6CD5\u8F93\u51FA\u5230\u5C4F\u5E55, \u9488\u5BF9\u8FD9\u4E2A\u95EE\u9898\u53EF\u4EE5\u91C7\u7528tee\u547D\u4EE4</p><p><code>adb logcat | grep -E &#39;^[VDE]/(TAG1|TAG2)&#39; | tee my.log</code></p><p><code>adb logcat -v time | tee a.log</code></p><h2 id="\u6301\u7EED\u8F93\u51FA\u65E5\u5FD7\u5230\u6587\u4EF6\u4E2D" tabindex="-1"><a class="header-anchor" href="#\u6301\u7EED\u8F93\u51FA\u65E5\u5FD7\u5230\u6587\u4EF6\u4E2D" aria-hidden="true">#</a> \u6301\u7EED\u8F93\u51FA\u65E5\u5FD7\u5230\u6587\u4EF6\u4E2D</h2><p><code>&gt;</code>\u8F93\u51FA : <code>&gt;</code> \u540E\u9762\u8DDF\u7740\u8981\u8F93\u51FA\u7684\u65E5\u5FD7\u6587\u4EF6, \u53EF\u4EE5\u5C06<code>logcat</code>\u65E5\u5FD7\u8F93\u51FA\u5230\u6587\u4EF6\u4E2D</p><p><code>adb logcat &gt; test.log</code> //\u5C06\u65E5\u5FD7\u4FDD\u5B58\u5230\u6587\u4EF6test.log</p><p><code>-d -f &lt;log&gt;</code> \u7EC4\u5408\u547D\u4EE4\uFF1A\u53EF\u4EE5\u5C06\u65E5\u5FD7\u4FDD\u5B58\u5230\u624B\u673A\u4E0A\u7684\u6307\u5B9A\u4F4D\u7F6E\uFF0C\u5BF9\u4E0D\u80FD\u4E00\u76F4\u7528\u7535\u8111\u8FDE\u7740\u624B\u673A\u6536\u96C6\u65E5\u5FD7\u7684\u573A\u666F\u975E\u5E38\u6709\u7528\u3002 <code>adb logcat -d -f /sdcard/mylog.txt</code></p><p>\u6700\u540E\u8BF4\u4E00\u4E0B\u4E0A\u9762\u7684<code>-v</code>\u7684\u683C\u5F0F\u95EE\u9898:<br><code>-v &lt;format&gt;</code>\u8BBE\u7F6E\u65E5\u5FD7\u8F93\u5165\u683C\u5F0F\u63A7\u5236\u8F93\u51FA\u5B57\u6BB5\uFF0C\u9ED8\u8BA4\u7684\u662F<code>brief</code>\u683C\u5F0F:</p><ul><li><code>brief</code> \u2014 \u663E\u793A\u4F18\u5148\u7EA7/\u6807\u8BB0\u548C\u539F\u59CB\u8FDB\u7A0B\u7684PID (\u9ED8\u8BA4\u683C\u5F0F)</li><li><code>process</code> \u2014 \u4EC5\u663E\u793A\u8FDB\u7A0BPID</li><li><code>tag</code> \u2014 \u4EC5\u663E\u793A\u4F18\u5148\u7EA7/\u6807\u8BB0</li><li><code>thread</code> \u2014 \u4EC5\u663E\u793A\u8FDB\u7A0B\uFF1A\u7EBF\u7A0B\u548C\u4F18\u5148\u7EA7/\u6807\u8BB0</li><li><code>raw</code> \u2014 \u663E\u793A\u539F\u59CB\u7684\u65E5\u5FD7\u4FE1\u606F\uFF0C\u6CA1\u6709\u5176\u4ED6\u7684\u5143\u6570\u636E\u5B57\u6BB5</li><li><code>time</code> \u2014 \u663E\u793A\u65E5\u671F\uFF0C\u8C03\u7528\u65F6\u95F4\uFF0C\u4F18\u5148\u7EA7/\u6807\u8BB0\uFF0CPID</li><li><code>long</code> \u2014\u663E\u793A\u6240\u6709\u7684\u5143\u6570\u636E\u5B57\u6BB5\u5E76\u4E14\u7528\u7A7A\u884C\u5206\u9694\u6D88\u606F\u5185\u5BB9</li><li><code>adb logcat -v thread</code> //\u4F7F\u7528 thread \u8F93\u51FA\u683C\u5F0F <em><strong>\u6CE8\u610F</strong></em><code>-v</code> \u9009\u9879\u4E2D\u53EA\u80FD\u6307\u5B9A\u4E00\u79CD\u683C\u5F0F\u3002</li></ul><hr><ul><li>\u90AE\u7BB1 \uFF1Acharon.chui@gmail.com</li><li>Good Luck!</li></ul>`,28),a=[i];function l(r,s){return o(),d("div",null,a)}var p=e(t,[["render",l],["__file","adb logcat\u4F7F\u7528\u7B80\u4ECB.html.vue"]]);export{p as default};
